(176470, '5AEBCF27-19F3-4D8D-B5B0-F657E9211CE5', 'The boys want to go to this magic event in San Diego.....which would be 9 to 11 hours of driving each way within  3 days', 'David', 'Nitzan', '2015-07-29T04:10:10'),
