(176327, 'E0AC58A2-28E1-49A2-97FD-CA57E72CC69B', 'No Marla ', 'David', 'Nitzan', '2015-07-29T04:10:22'),
(176455, 'FC67BF43-A10A-4E4E-9DAC-9C2BE471B074', 'We were going to do It with friends and they pulled out so we needed to cancel', 'David', 'Nitzan', '2015-07-29T04:10:54'),
(176394, 'BA2DE167-50DF-466C-A88B-3157CC22B9A3', 'Nathan goes to Marla and she tells him that she could only do it if her boyfriend of 3 weeks drives with. ', 'David', 'Nitzan', '2015-07-29T04:11:55'),
