(176320, '87719692-FB52-4238-B31A-0F52689E7DA3', 'We are discussing with our family therapist tomorrow. She keeps violating this agreement and now I will need to bring up with my lawyer (and lose more sleep)', 'David', 'Nitzan', '2015-07-29T04:19:18'),
