(176301, '29BC0EBC-9673-4C1B-9286-B4F830F82840', 'Marla doesn''t have rational thinking, so she''s going to make a lot of mistakes in this period. Your kids are going to remember you as totally thoughtful and present. And that is kinda all you can do right now. Marla also may not stay this way forever. She needs to go through her own healing process. ', 'Nitzan', 'David', '2015-07-29T04:22:37'),
(176464, '989F5DBF-5EC6-4D1D-A2CA-17EB821FFD06', 'I know. Just feel helpless and I know there will be other occasions. Just sucks. It''s actually a relief to me that she is seeing someone...I''m happy for her. And of course I would love for you to meet my boys...but it just wouldn''t be right for them (or for you).  ', 'David', 'Nitzan', '2015-07-29T04:29:12'),
(176314, '396D573B-4493-4E43-94D7-245F13C84C17', 'Yeah. I hear you. And that feeling of helplessness is definitely sucky. ', 'Nitzan', 'David', '2015-07-29T04:30:18'),
(176354, 'EE1E0ECC-026D-4243-9AFC-2F7BD8784AEC', 'And I totally get that I shouldn''t meet your kids anytime soon. ', 'Nitzan', 'David', '2015-07-29T04:30:32'),
